import React from "react";
import './Wiki.css';

function Wiki() {

    return (
        <div className="wiki">
           <div className="wiki__wrapper">
                <section className="wiki__main">
                    <h1 className="wiki__heading">ВИКИ «Cogni»</h1>
                </section>

                <section className="wiki__types">

                </section>
           </div>
        </div>
    );
};

export default Wiki;
